import React from "react";
import "./MainPage.css";
import { Box, Typography } from "@mui/material";

const MainPage = () => {
  return (
    <Box className="mainPage">
      <Box sx={{ display: "flex", flexDirection: "column",width:"100%" }}>
        <Typography variant="h5" sx={{ fontWeight: "bold" }}>
          상품 리스트
        </Typography>
        <Box sx={{ display: "flex", flexDirection: "column" }}>
          <img></img>
          <Box sx={{ display: "flex"}}>
            <Typography>상품이름</Typography>
            <Typography>% or 관심 고객수</Typography>
          </Box>
          <Box sx={{ display: "flex"}}>
            <Typography>기획전 설명</Typography>
            <Typography>가격 or 고객수</Typography>
          </Box>
        </Box>
      </Box>
      <Box sx={{ display: "flex", flexDirection: "column",width:"100%" }}>
        <Typography variant="h5" sx={{ fontWeight: "bold" }}>
          북마크 리스트
        </Typography>
      </Box>
    </Box>
  );
};

export default MainPage;
